import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import { Tooltip } from '@mui/material';

const Footer = () => {
  return (
    <Box 
      className="footer" 
      sx={{ 
        /*background: 'url(../img/footer.png) center center no-repeat',*/ 
        backgroundSize: 'contain', 
        padding: '40px 20px',
        backgroundColor: '#14183e' 
      }}
    >
      <Grid container spacing={5}>
        <Grid item md={6} lg={3}>
          <Tooltip title="Logo">
            <Typography variant="h5" className="mb-3 #fffff">
              Virtual Mechatronics
            </Typography>
          </Tooltip>
          <Typography mb={0}>Unlocking the potential: Virtually</Typography>
        </Grid>
        <Grid item md={6} lg={3}>
          <Typography variant="h6" className="mb-4 text-white">Get in touch</Typography>
          <Typography>
            <i className="fa fa-map-marker-alt me-3"></i> Nyeri, Kenya
          </Typography>
          <Typography>
            <i className="fa fa-phone-alt me-3"></i> +25416115027
          </Typography>
          <Typography>
            <i className="fa fa-envelope me-3"></i> vr.africa@dkut.ac.ke
          </Typography>
          <Box sx={{ display: 'flex', pt: 2 }}>
            {['twitter', 'facebook', 'youtube', 'instagram', 'linkedin-in'].map((icon, index) => (
              <Button 
                key={index} 
                className="btn btn-social"
                sx={{
                  color: 'rgba(255,255,255,.5)',
                  border: '1px solid rgba(255,255,255,.1)',
                  borderRadius: '40px',
                  width: '40px',
                  height: '40px',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  transition: '.3s',
                  '&:hover': {
                    color: 'var(--primary)',
                  }
                }}
                href="#"
              >
                <i className={`fab fa-${icon}`}></i>
              </Button>
            ))}
          </Box>
        </Grid>
        <Grid item md={6} lg={3}>
          <Typography variant="h6" className="mb-4 text-white">Popular Links</Typography>
          {['About Us', 'Contact Us', 'Privacy Policy', 'Terms and Conditions', 'Career'].map(link => (
            <Button 
              key={link} 
              className="btn btn-link"
              sx={{
                display: 'block',
                marginBottom: '10px',
                padding: 0,
                textAlign: 'left',
                color: 'rgba(255,255,255,.5)',
                fontWeight: 'normal',
                transition: '.3s',
                '&::before': {
                  content: '"\\f105"',
                  fontFamily: '"Font Awesome 5 Free"',
                  fontWeight: 900,
                  marginRight: '10px',
                },
                '&:hover': {
                  color: '#FFFFFF',
                  letterSpacing: '1px',
                  boxShadow: 'none',
                },
              }}
              href="#"
            >
              {link}
            </Button>
          ))}
        </Grid>
        <Grid item md={6} lg={3}>
          <Typography variant="h6" className="mb-4 text-white">Our Projects</Typography>
          {['Virtual Reality', 'Virtual Mechatronics', 'Designs', 'Trainings'].map(project => (
            <Button 
              key={project} 
              className="btn btn-link"
              sx={{
                display: 'block',
                marginBottom: '10px',
                padding: 0,
                textAlign: 'left',
                color: 'rgba(255,255,255,.5)',
                fontWeight: 'normal',
                transition: '.3s',
                '&::before': {
                  content: '"\\f105"',
                  fontFamily: '"Font Awesome 5 Free"',
                  fontWeight: 900,
                  marginRight: '10px',
                },
                '&:hover': {
                  color: '#FFFFFF',
                  letterSpacing: '1px',
                  boxShadow: 'none',
                },
              }}
              href="#"
            >
              {project}
            </Button>
          ))}
        </Grid>
      </Grid>
      <Box className="copyright" sx={{ mt: 4, padding: '25px 0', fontSize: '14px', borderTop: '1px solid rgba(255,255,255,.1)' }}>
        <Typography variant="body2" align="center">
          Â© <a href="#" style={{ color: 'rgba(255,255,255,.5)', textDecoration: 'none' }} className="border-bottom">Virtual Mechatronics</a> All Rights Reserved.
        </Typography>
        <Box className="footer-menu" sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
          {['Home', 'Cookies', 'Help'].map((item, index) => (
            <Button 
              key={index} 
              href="#" 
              sx={{ 
                color: 'rgba(255,255,255,.5)', 
                marginRight: index !== 2 ? '15px' : 0,
                paddingRight: index !== 2 ? '15px' : 0,
                borderRight: index !== 2 ? '1px solid rgba(255,255,255,.1)' : 'none',
                '&:hover': {
                  color: '#FFFFFF',
                }
              }}
            >
              {item}
            </Button>
          ))}
        </Box>
      </Box>
    </Box>
  );
};

export default Footer;
